public void init()
{
    EFDocumentReceivedXML_BR xml;
    EFDocAccessKey_BR        accessKey;

    super();

    accessKey = element.args().parm();

    efDocumentReceivedXML_BR_ds.queryBuildDataSource().clearDynalinks();

    if (element.args().dataset() == tableNum(EFDocumentReceivedXML_BR))
    {
        xml = element.args().record();
    }
    else if (accessKey)
    {
        select firstOnly accessKey, RecId from xml
            where xml.Accesskey == accessKey;
    }
    else
    {
        throw error("@SYS22996");
    }

    if (EFDocumentReceivedXML_BR::hasAnyXmlForAccessKey(xml.Accesskey) == false)
    {
        throw error("@SYS4010064", '', SysInfoAction_MenuFunction::newMenuItem(menuitemDisplayStr(EFDocumentReceivedXML_BR), MenuItemType::Display));
    }

    efDocumentReceivedXML_BR_ds.queryBuildDataSource().addRange(fieldNum(EFDocumentReceivedXML_BR, RecId)).value(queryValue(xml.RecId));
    xmlDocumentReceived_DS.queryBuildDataSource().addRange(fieldNum(EFDocumentReceivedXMLData_BR, XmlDataType)).value(queryValue(EFDocReceivedXMLDataType_BR::Received));
    xmlDocumentInquiry_DS.queryBuildDataSource().addRange(fieldNum(EFDocumentReceivedXMLData_BR, XmlDataType)).value(queryValue(EFDocReceivedXMLDataType_BR::Inquiry));
    xmlDocumentInquiryResponse_DS.queryBuildDataSource().addRange(fieldNum(EFDocumentReceivedXMLData_BR, XmlDataType)).value(queryValue(EFDocReceivedXMLDataType_BR::InquiryResponse));
}

/// <summary>
/// Indicates if the NF-e XML has been received.
/// </summary>
/// <returns>
/// True if the NF-e XML has been received; false otherwise
/// </returns>
public boolean nfeXmlDataHasBeenReceived()
{
    return efDocumentReceivedXmlView_BR.RecId != 0;
}

public void updateDesign()
{
    #task

    if (element.nfeXmlDataHasBeenReceived() == false)
    {
        element.task(#taskSwitchToHeaderDetailsView); // Shows the Header view

        this.hideNonRawXmlFields();
    }
    else
    {
        element.task(#taskSwitchToLineDetailsView); // Shows the Line view
    }

    this.adjustExportButtons();
}

private void sendXmlToUser(RefRecId _receivedXmlReference, str _xmlType = '')
{
    EFDocumentReceivedXML_BR receivedXml = EFDocumentReceivedXML_BR::findByRecId(_receivedXmlReference);
    EFDocXmlExporter_BR::sendReceivedXmlToUser(XMLDocumentReceived.XMLDocument,
                                                                    EFDocAccessKeyBase_BR::getCNPJNumber(receivedXml.AccessKey),
                                                                    EFDocAccessKeyBase_BR::getInvoiceNumber(receivedXml.AccessKey),
                                                                    EFDocAccessKeyBase_BR::getInvoiceSeries(receivedXml.AccessKey),
                                                                    _xmlType);
}

public void setTitleText()
{
    var vendorName = EFDocumentReceivedXML_BR.thirdPartyName();
    vendorName = vendorName ? strFmt(' : %1', vendorName) : '';
    DetailsTitleString.text(strFmt('%1%2', EFDocumentReceivedXML_BR.Accesskey, vendorName));
}

public int active()
{
    int ret;

    ret = super();

    element.setTitleText();
    element.updateDesign();

    return ret;
}

